import React from 'react';
import { Button} from 'reactstrap';
class MyClassComponent extends React.Component{
    createSomething = () => {
        console.log(this.props.data.seatOccupied);
        let seatUsed;
        if(this.props.data.seatOccupied ===0){
            seatUsed = "success"
        }
        else{
            seatUsed = "danger"
        }
        return seatUsed;
    }
    render() {
        return (
        <Button size="sm" color={this.createSomething}>{this.props.row}{this.props.num}</Button>
        );
    }
    
};

export default MyClassComponent;
